import React from 'react'
import {GetStaticProps} from 'next'
import {Home} from '../src/components/home/Home'


const Index = () => {
    return (
        <Home data={{name: 'test'}}/>
    )
}

export const getStaticProps: GetStaticProps = async () => {

    return {
        props: {},
    }
};

export default Index;
